To activate this card, you must draw it for your normal draw in your Draw Phase, reveal it, and keep it revealed until the Main Phase 1. During your Main Phase 1 that same turn: You can activate this card from your hand and target 1 "Utopia" Xyz Monster you control, then activate 1 of these effects;
<br>• Equip any number of "ZW -" monsters with different names from your Deck and/or Extra Deck to that monster.
<br>• Special Summon from your Extra Deck, 1 "Utopia" Xyz Monster with a different name, by using that target as material. (This is treated as an Xyz Summon. Transfer its materials to the Summoned monster.)

Every "Dark Magician" in your Monster Zone is unaffected by your opponent's card effects. If this face-up card leaves the field: Destroy all monsters you control. You can only use the following effect of "Eternal Soul" once per turn. You can activate 1 of these effects;
<br>• Special Summon 1 "Dark Magician" from your hand or GY.
<br>• Add 1 "Dark Magic Attack" or "Thousand Knives" from your Deck to your hand.
